import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Navigation, Footer, Home, Contact, SignUp, SignIn, Doctprofile } from "./components";

class App extends React.Component {
  constructor() {
    super();
  }

RouterHome(){
  if(false){
  return(
    <Route exact path="/" element={<Home />} />
  )}
  else{
    return(
    <Route exact path="/" element={<Home />} />
    )
  }
}



  render() {
    return (
      <div className="App">
        <Router>
          <Navigation />
          <Routes>
            {this.RouterHome()}
            <Route path="/doctorNotAPP" element={<Doctprofile />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/signin" element={<SignIn />} />
          </Routes>
        </Router>
      </div>
    );
  }
}
export default App;
